import {useEffect, useState} from 'react';
import React from 'react';
import './App.css';

import axios from "axios";

function App() {

   const [data, setData] = useState([])

    useEffect(() => {
        axios.get('http://localhost:8080/accounts/1')
            .then(res=> {
                console.log(res.data)
                setData(res.data)
            }).catch(err => {
            console.log(err)
        })
    },[])

    const arr = data.map((data , index) => {
        return (
            <tr>
                <td>{data.userID}</td>
                <td></td>
                <td></td>
            </tr>
        )
    })


  return (
      <div>
          <table>
              <tr>
                  <th>Company</th>
                  <th>Contact</th>
                  <th>Country</th>
              </tr>
          </table>
      </div>
  );
}

export default App;
